// Now let's fix the React component that calls this API
import React, { useState, useEffect } from "react"; 
import { useNavigate } from "react-router-dom"; 
import { createContract } from '../services/api'; // Import API call 
import "./contract.css";  
 
function ContractPage() { 
  const navigate = useNavigate(); 
  const [formData, setFormData] = useState({ 
    job_id: "", 
    hr_id: "", // This will be! set from localStorage/sessionStorage or default to 1
    salary: "", 
    probation_period: "", 
    start_date: "", 
    end_date: "", 
    benefits: "", 
  }); 
  
  const [successMessage, setSuccessMessage] = useState("");
  const [errorMessage, setErrorMessage] = useState("");

  // Get HR ID using the specified logic when component mounts
  useEffect(() => {
    const hr_id = localStorage.getItem("hr_id") || sessionStorage.getItem("hr_id") || 1;
    
    setFormData(prevData => ({
      ...prevData,
      hr_id: hr_id
    }));
  }, []);
 
  const handleChange = (e) => { 
    setFormData((prevData) => ({ 
      ...prevData, 
      [e.target.name]: e.target.value, 
    })); 
  }; 
 
  const handleSubmit = async () => {
    // Reset messages
    setSuccessMessage("");
    setErrorMessage("");
    
    // Check only user-fillable fields
    const visibleFields = ['job_id', 'salary', 'probation_period', 'start_date', 'end_date', 'benefits'];
    const emptyFields = visibleFields.filter(field => !formData[field]);
    
    if (emptyFields.length > 0) { 
      setErrorMessage("Please fill in all fields before submitting.");
      return; 
    } 
 
    try {
      // Format the request data to match exactly what the backend expects
      const contractData = {
        job_id: parseInt(formData.job_id, 10),  // Ensure integers are sent as numbers
        hr_id: parseInt(formData.hr_id, 10),
        salary: formData.salary,
        probation_period: parseInt(formData.probation_period, 10),
        start_date: formData.start_date,
        end_date: formData.end_date,
        benefits: formData.benefits
      };
      
      console.log("Submitting contract data:", contractData);
      
      const response = await createContract(contractData);
      setSuccessMessage("Contract Created Successfully!");
      console.log("Contract creation response:", response);
      
      // Clear form fields after successful submission
      setFormData({
        job_id: "", 
        hr_id: formData.hr_id, // Keep the HR ID
        salary: "", 
        probation_period: "", 
        start_date: "", 
        end_date: "", 
        benefits: "", 
      });
    } catch (error) { 
      console.error("Error creating contract:", error);
      setErrorMessage("Failed to create contract: " + (error.message || "Unknown error")); 
    } 
  }; 
  
  const handleBack = () => {
    navigate(-1); // Navigate back only when back button is clicked
  };
 
  return ( 
    <div className="contract-page-container"> 
      <button className="contract-back-button" onClick={handleBack}>Back</button> 
      <h2>Contract</h2>
      
      {/* Display messages if available */}
      {successMessage && (
        <div className="success-message" style={{ color: 'green', padding: '10px', marginBottom: '10px' }}>
          {successMessage}
        </div>
      )}
      
      {errorMessage && (
        <div className="error-message" style={{ color: 'red', padding: '10px', marginBottom: '10px' }}>
          {errorMessage}
        </div>
      )}
      
      <div className="contract-content"> 
        <div className="contract-form"> 
          <label>Job ID</label> 
          <input type="number" name="job_id" value={formData.job_id} onChange={handleChange} /> 
 
          <label>Salary</label> 
          <input type="text" name="salary" value={formData.salary} onChange={handleChange} /> 
 
          <label>Probation Period (days)</label> 
          <input type="number" name="probation_period" value={formData.probation_period} onChange={handleChange} /> 
 
          <label>Contract Start Date</label> 
          <input type="date" name="start_date" value={formData.start_date} onChange={handleChange} /> 
 
          <label>Contract End Date</label> 
          <input type="date" name="end_date" value={formData.end_date} onChange={handleChange} /> 
 
          <label>Benefits</label> 
          <input type="text" name="benefits" value={formData.benefits} onChange={handleChange} /> 
        </div>
      </div> 
 
      <button className="contract-submit-button" onClick={handleSubmit}>Submit</button> 
    </div> 
  ); 
} 
 
export default ContractPage;
